/* jshint esversion: 6 */
import React from 'react';
import GoogleMapReact from 'google-map-react';

export default function map() {
    return (
        <div>
            <GoogleMapReact
                defaultCenter={{ lat: -34.397, lng: 150.644 }}
                defaultZoom={11}>
            </GoogleMapReact>
        </div>
    )
}
